import "./Contact.css";

function Contact() {
  return (
    <div id="contact" className="contact-container">
      <p>Amara Ceresi</p>
      <p>Location</p>
      <p>+1 (555) 555-5555</p>
      <p>email@email.com</p>
    </div>
  )
}

export default Contact
